import React, { Component } from "react"
import Form from "./Form"

class Home extends Component {
  constructor(props) {
    super(props)
  }

  handleChange(e) {
    console.log(e.target)
  }

  render() {
    return (
      <div className="container">
        <div className="row">
          <Form />
        </div>
      </div>
    )
  }
}

export default Home
